body:
Maybe we should check it like that:

`org.eclipse.xtext.xbase.validation.XbaseValidator.checkTypes(XCatchClause)`:

```java
	@Check
	public void checkTypes(XCatchClause catchClause) {
		LightweightTypeReference parameterType = getActualType(catchClause, catchClause.getDeclaredParam());
		if (parameterType != null && !parameterType.isSubtypeOf(Throwable.class)) {
			error("No exception of type " + parameterType.getHumanReadableName()
					+ " can be thrown; an exception type must be a subclass of Throwable",
					catchClause.getDeclaredParam(), TypesPackage.Literals.JVM_FORMAL_PARAMETER__PARAMETER_TYPE,
					ValidationMessageAcceptor.INSIGNIFICANT_INDEX, INCOMPATIBLE_TYPES);
		}
	}
```

Even like that it still does not work:

```java
	def protected checkType(EObject context, JvmTypeReference actualType, Class<?> expectedType,
			EStructuralFeature feature) {
		if (actualType !== null) {
			val lightweightActualType = toLightweightTypeReference(actualType)
			if (!(lightweightActualType).isSubtypeOf(expectedType)) {
				error("Type mismatch: cannot convert from " + actualType.simpleName +
					" to " + expectedType.simpleName,
					context,
					feature,
					TYPE_MISMATCH);
			}
		}
	}
```

The problem is that the supertype is java.lang.Object.

The problem can be reproduced even without tests: just start a second instance, create a project with the DSL, delete the project from the workspace, create another project with the DSL, SAME NAME, different template and you get the problem.

the marker stays only on the editor, it's not in the problems view

@merks sorry, I didn't know this could break EPP. @pcdavid notified me about the unused dependency, so I thought it would be safe.

Should I do anything from my side?

I can only confirm that we don't use EMF Query in Parsley; maybe it ended up there at the beginning for some experiments,
